import React, { useState } from 'react';
import Navbar from './navbar';
import Bhajanamindralu from '../components/bhajanmindralu';
import Users from '../components/users';
import Reports from '../components/reports';
import './landing.css';

const Landing = () => {
  const [activePage, setActivePage] = useState('');

  const renderPageContent = () => {
    if (activePage === '') {
      return <DefaultContent />;
    }
    switch (activePage) {
      case 'bhajanamindralu':
        return <Bhajanamindralu />;
      case 'users':
        return <Users />;
      case 'reports':
        return <Reports />;
      default:
        return null;
    }
  };

  return (
    <div className="landing-page">
      <Navbar setActivePage={setActivePage} />
      <div className="content-wrapper">
        <div className="image-container1">
          <div className="image-overlay"></div>
          <img src={`${process.env.PUBLIC_URL}/assets/landingtemple1.jpeg`} alt="Temple" />
        </div>
        <div className="image-container1">
          <div className="image-overlay"></div>
          <img src={`${process.env.PUBLIC_URL}/assets/landingtemple1.jpeg`} alt="Temple" />
        </div>
        <div className="page-content">{renderPageContent()}</div>
      </div>
    </div>
  );
};

const DefaultContent = () => {
